import React from 'react';
import Game from '../Game/Game';
import  { Grid 
} from 'semantic-ui-react';

const GamesContainer = (props) => {
    const { games } = props
    return (
        <Grid column='equal'>
            <Grid.Column>
                <Segment>3</Segment>
            {games.map(game => <Game game={game} />)}
            </Grid.Column>
        </Grid>

    )
}



export default GamesContainer;
